import logo from "./logo.svg";
import "./App.css";

function App() {
  const title = "welcome to the new blog";
  const likes = 50;
  return (
    <div className="App">
      <div className="content">
        <h1>{title}</h1>
        <p>liked {likes} times</p>
        <p>{100}</p>
        <p>{"hello ninjas"}</p>
      </div>
    </div>
  );
}

export default App;
